import React from 'react';
import styled from '@emotion/styled';

const Btn = styled.input`
    position: absolute;
    top: 5px;
    right: 5px;
    -webkit-appearance: none;
    background-color: red;  
    width: 90px;
    height: 30px;  
    border-radius: 100px;
    transition: all ease 0.3s;  
`;


const SwitcherTheme = () => {
    return (
        <Btn type="checkbox"/>
    );    
}

export default SwitcherTheme;
